import logo from './logo.svg';
import './dropdown.css';

const  Dropdown: React.VFC = () => {
  return (
    <button className="button">
      <div className="text">
        <p className="text-1">Select A Region</p>
      </div>
      <div className="icon-set-2">
        <img src="" />
      </div>
    </button>
  )
}

export default Dropdown;
